<!DOCTYPE html>
<html>
<head>
<meta charset="UTF-8" />

<style id="webmakerstyle">
@font-face {
  font-family: "gothambold";
  src: url("https://files.sobloxsy.com/gothambold-webfont.woff2")
      format("woff2"),
    url("https://files.sobloxsy.com/gothambold-webfont.woff") format("woff");
  font-weight: normal;
  font-style: normal;
}
@font-face {
  font-family: "gothammedium";
  src: url("https://files.sobloxsy.com/gothammedium-webfont.woff2")
      format("woff2"),
    url("https://files.sobloxsy.com/gothammedium-webfont.woff") format("woff");
  font-weight: normal;
  font-style: normal;
}
@font-face {
  font-family: "product_sansregular";
  src: url("https://files.sobloxsy.com/product_sans_regular-webfont.woff2")
      format("woff2"),
    url("https://files.sobloxsy.com/product_sans_regular-webfont.woff")
      format("woff");
  font-weight: normal;
  font-style: normal;
}

h1 {
  font-size: 50px;
}

body {
  width: 100%;
  height: 81.5%;
  text-align: center;
  font-family: product_sansregular;
  color: #222122;
  background: white;
  margin: 0px;
  align-items: center;
  position: absolute;
  top: 13%;
  border-radius: 20px;
}
.searchbtn {
  font-family: arial, sans-serif !important;
  outline: 0px;
  color: #3c4043;
  background-color: #f8f9fa;
  border: 1px solid #f8f9fa;
  border-radius: 4px;
  font-size: 14px;
  margin: 11px 4px;
  padding: 0 16px;
  line-height: 27px;
  height: 36px;
  min-width: 54px;
  text-align: center;
  cursor: pointer;
  user-select: none;
}
.searchbtn:hover {
  border: 1px solid #dfe1e5;
  border-bottom-width: 2px;
}

input {
  border-radius: 24px !important;
  font-family: product_sansregular;
  outline: none !important;
  border: 1px solid #dfe1e5;
  width: 100%;
  background: #fff;
  display: flex;
  box-shadow: none;
  z-index: 3;
  height: 44px !important;
  margin: 0 auto;
  text-align: center;
  font-size: 16px;
  transition-duration: 0.5s;
  max-width: 584px;
}
input:hover,
input:focus {
  box-shadow: 0 2px 5px 1px rgb(64 60 67 / 16%);
}

.searchholder {
  width: 100%;
}
.searchbarhold {
  position: relative;
  margin: 0 auto;
  padding-top: 6px;
  width: 70%;
}

.logo {
  height: auto;
  min-width: 150px;
  max-width: 300px;
  width: 100%;
  transition-duration: 0.2s;
}
.logo:hover {
  width: 320px;
}
.sublogo,
.sub {
  font-size: 15px;
  color: rgb(81, 81, 81) !important;
  margin-top: -25px;
  transition-duration: 0.2s;
  vertical-align: center;
}
.sub:hover {
  font-size: 18px;
}

.bottombar {
  position: absolute;
  bottom: 0%;
  background: #f2f2f2;
  width: 100%;
  height: 30px;
  text-align: center;
  top: 100%;
  padding-top: 10px;
}

.bomtext {
  text-decoration: none;
  color: #70757a;
  font-size: 16px;
  text-align: center;

}

.dark-mode {
  filter: invert(1);
}

.tdm {
  border: 1px;
  font-family: product_sansregular;
  color: white;
  border-radius: 10px;
  background: #2f2f30;
  font-size: 16px;
}

.subbtn {
  font-family: arial, sans-serif !important;
  outline: 0px;
  color: #ffffff;
  background-color: #3487da;
  border: 1px solid #3487da;
  border-radius: 4px;
  font-size: 14px;
  margin: 11px 4px;
  padding: 0 16px;
  line-height: 27px;
  height: 36px;
  min-width: 54px;
  text-align: center;
  cursor: pointer;
  user-select: none;
}
.subbtn:hover {
  border: 1px solid #2d75bd;
  border-bottom-width: 2px;
}

.textbtn {
  color: white;
}

.top {
  text-align: left;
}

a {
  text-decoration: none;
  color: #46494d;
}

.toptext {
  display: inline-block;
  padding: 5px;
  margin: 0 5px;
  color: #222;
  margin-left: 15px;
}

.wjka {
  text-align: center;
  font-family: "gothammedium", sans-serif;
  bottom: -100px;
  position: fixed;
}

.smile {
  width: 30px;
  margin-bottom: -10px;
}

</style>
</head>
